import styled from "styled-components";

const Section = styled.section`
  width: 100vw;
  background-color: ${(props) => props.theme.body};
`;
const NavBar = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;
function Navigation() {
  return (
    <Section>
      <NavBar>
        <h2>Logos</h2>
        <h2>Menu</h2>
        <h2>Button</h2>
      </NavBar>
    </Section>
  );
}

export default Navigation;
